import Link from "next/link"; //引入Link連結

// export default () => <div>about.js</div>;
//當URL直接調整成/about就可以轉到這個頁面
const About = () => (
  <div>
    <ul>
      <li>
        <Link href="/">
          <a>Home</a>
        </Link>
      </li>
      <li>
        <Link href="/about">
          <a>About</a>
        </Link>
      </li>
    </ul>
    <h3>Welcome to Next</h3>
  </div>
);

export default About;
